  ["Vitamin A equiv.", "735 mg", "104%"],
];

const HeadTable = () => {
  return (
    <table className={classes.headTable}>
      <thead>
        {headings.map((item) => (
          <th key={Math.random() + Date.now()}>{item}</th>
